        <div>RECENT WORKS</div>
        <div className='grid grid-cols-2 gap-4 mt-4 px-4 '>
          <div className="">
          <a href="https://instagram.com/dyuksha.nssce" target="_blank" rel="noopener noreferrer"> 
            <div className='row-span-full flex flex-row justify-center items-center text-2xl border border-gray-800 rounded-lg p-4 hover:bg-zinc-800 hover:cursor-pointer'>    
